                    </Bubble>
                </Welcome>
            </Mask>
        </Cover>
        <Content>
            <Union icon={newIcon} title="The Latest!">
                <CardList />
                <LinkBtn to="/">More</LinkBtn>
            </Union>
        </Content>
    </div>)
}

export default Home;
